import React from "react";
import Typography from "@mui/material/Typography";
import { styled } from "@mui/material/styles";
import Grid from "@mui/material/Grid";
import Paper from "@mui/material/Paper";
import Box from "@mui/material/Box";

import Setting from "../common/setting"

import RunningServices from "../common/runningServier"

const Item = styled(Paper)(({ theme }) => ({
  backgroundColor: theme.palette.mode === "dark" ? "#1A2027" : "#fff",
  ...theme.typography.body2,
  padding: theme.spacing(1),
  textAlign: "center",
  color: theme.palette.text.secondary,
}));

function EnvServices(props) {
  return (
    <div>
      <div>
        <Typography variant="h4" align="start" padding={2}>
          Dev Enviroment Services
        </Typography>
        <Typography variant="h6" align="start" padding={2}>
          Dev Enviroment Services
        </Typography>
      </div>

      <Box sx={{ width: "100%" }}>
        <Grid container rowSpacing={1} columnSpacing={{ xs: 1, sm: 2, md: 3 }}>
          <Grid item xs={6}>
          <Setting/>
          </Grid>
          <Grid item xs={6}>
            <Grid container>
              <Grid item xs={12}>
  
      
                <RunningServices data ='Setting' width ="90%" running = "Running" Services = "Services" numberShow ="2"/>
     
              </Grid>
              <Grid item xs={12}>
        
                <RunningServices data ='Setting' width ="90%" running = "Running" Services = "Services" numberShow ="2"/>
              
              </Grid>
            </Grid>
          </Grid>
        </Grid>
      </Box>
    </div>
  );
}

export default EnvServices;
